using namespace std;
class Solution {
public:

    static int solve(const vector<int>& tops, const vector<int>& bottoms) {
        const auto n = size(tops);
        vector<vector<int>> dp(n, vector<int>(2, -1));
        dp[0][0] = 0;
        dp[0][1] = 1;

        for (int i = 1; i < n; i++) {
            if (dp[i - 1][0] >= 0) {
                dp[i][0] = tops[0] == tops[i] ?
                    dp[i - 1][0]
                    : tops[0] == bottoms[i] ? dp[i - 1][0] + 1 : -1;
            }
            if (dp[i - 1][1] >= 0) {
                dp[i][1] = tops[0] == bottoms[i] ?
                    dp[i - 1][1]
                    : tops[0] == tops[i] ? dp[i - 1][1] + 1 : -1;
            }
        }

        if (dp[n - 1][0] >= 0) {
            if (dp[n - 1][1] >= 0) {
                return min(dp[n - 1][0], dp[n - 1][1]);
            }
            else {
                return dp[n - 1][0];
            }
        }
        else {
            if (dp[n - 1][1] >= 0) {
                return dp[n - 1][1];
            }
            else {
                return -1;
            }
        }
    }


    int minDominoRotations(vector<int>& tops, vector<int>& bottoms) {
        const auto ans1 = solve(tops, bottoms);
        const auto ans2 = solve(bottoms, tops);
        if (ans1 >= 0) {
            if (ans2 >= 0) {
                return min(ans1, ans2);
            }
            else {
                return ans1;
            }
        }
        else {
            if (ans2 >= 0) {
                return ans2;
            }
            else {
                return -1;
            }
        }
    }
};

void test(vector<int>&& tops, vector<int>&& bottoms) {
    cout << Solution().minDominoRotations(tops, bottoms) << endl;
}
